window.bookSummaryJSON = "<p>Multiple Hugo Award winner Elizabeth Bear enthralls fans with this compelling first book in the Eternal Sky series. </p> <p>In a world where wizards are unable to procreate, Temur, heir to his empire’s throne, flees to avoid assassination. Once-Princess Samarkar, formerly heir to her own empire’s throne, gives up everything to seek the wizards’ magical power. Drawn together by fate, Temur and the Once-Princess must stand against a cult inciting strife and civil war in all the empires.</p>"; 
